<script type="text/javascript">
function get(_) {
return  document.getElementById(_);
}

function hardwareTest() {
var hardware=get("hardware").value;
if(!hardware) {
alert('Nie wypelniono pola "Trace of hardware"');
} else {
new Ajax.Request("licencja.php",
{
method: "POST",
parameters: {"cmd": "testhardware", "hardware": hardware},
onSuccess: function(response) {
if(response.responseText == "Ok") {
get("validOk").style.display="";
get("validFail").style.display="none";
} else {
get("validOk").style.display="none";
get("validFail").style.display="";
}
},
}
);
}

return false;
}
</script>
